async function _createManyGigs() {
  try {
    const gigs = await query();
    if (!gigs || !gigs.length) {
      utilService.saveToStorage(KEY, gGigsTest);
      gGigsTest.forEach(gig => {
        save(gig);
      });

    }
  }
  catch (err) {
    console.error('Cannot get gigs', err);
  }
}

